import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import API from '../utils/api';

const CreateOrganisationPage = () => {
  const [formData, setFormData] = useState({
    name: '',
    incorporationId: '',
    description: '',
    address: '',
    phoneNumber: '',
    contactEmail: '',
    website: '',
  });
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleCreateOrganisation = async (e) => {
    e.preventDefault();
    try {
      await API.post('/organisations/create', formData, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
      });
      navigate('/dashboard');
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to create organisation');
    }
  };

  return (
    <div className="flex h-screen items-center justify-center bg-gradient-to-br from-blue-500 to-indigo-600 text-white">
      <div className="bg-white shadow-lg rounded-lg p-8 w-full max-w-lg text-gray-800">
        <div className="text-center">
          <h1 className="text-3xl font-bold mb-4 text-indigo-600">Create Your Organisation</h1>
          <p className="text-gray-500 text-sm mb-6">
            Build your organisation's space to collaborate, manage projects, and achieve your goals.
          </p>
        </div>

        {error && <p className="text-red-500 bg-red-100 p-2 rounded mb-4 text-sm">{error}</p>}

        <form onSubmit={handleCreateOrganisation} className="space-y-4">
          <div>
            <label htmlFor="name" className="block text-sm font-medium text-gray-700 mb-1">
              Organisation Name
            </label>
            <input
              id="name"
              type="text"
              placeholder="Enter Organisation Name"
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={formData.name}
              onChange={(e) => setFormData({ ...formData, name: e.target.value })}
            />
          </div>
          <div>
            <label htmlFor="incorporationId" className="block text-sm font-medium text-gray-700 mb-1">
              Incorporation ID
            </label>
            <input
              id="incorporationId"
              type="text"
              placeholder="Enter Incorporation ID"
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={formData.incorporationId}
              onChange={(e) => setFormData({ ...formData, incorporationId: e.target.value })}
            />
          </div>
          <div>
            <label htmlFor="description" className="block text-sm font-medium text-gray-700 mb-1">
              Description
            </label>
            <input
              id="description"
              type="text"
              placeholder="Enter Description"
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={formData.description}
              onChange={(e) => setFormData({ ...formData, description: e.target.value })}
            />
          </div>
          <div>
            <label htmlFor="address" className="block text-sm font-medium text-gray-700 mb-1">
              Address
            </label>
            <input
              id="address"
              type="text"
              placeholder="Enter Address"
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={formData.address}
              onChange={(e) => setFormData({ ...formData, address: e.target.value })}
            />
          </div>
          <div>
            <label htmlFor="phoneNumber" className="block text-sm font-medium text-gray-700 mb-1">
              Phone Number
            </label>
            <input
              id="phoneNumber"
              type="text"
              placeholder="Enter Phone Number"
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={formData.phoneNumber}
              onChange={(e) => setFormData({ ...formData, phoneNumber: e.target.value })}
            />
          </div>
          <div>
            <label htmlFor="contactEmail" className="block text-sm font-medium text-gray-700 mb-1">
              Contact Email
            </label>
            <input
              id="contactEmail"
              type="email"
              placeholder="Enter Contact Email"
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={formData.contactEmail}
              onChange={(e) => setFormData({ ...formData, contactEmail: e.target.value })}
            />
          </div>
          <div>
            <label htmlFor="website" className="block text-sm font-medium text-gray-700 mb-1">
              Website
            </label>
            <input
              id="website"
              type="text"
              placeholder="Enter Website"
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={formData.website}
              onChange={(e) => setFormData({ ...formData, website: e.target.value })}
            />
          </div>
          <button
            type="submit"
            className="w-full bg-indigo-600 text-white font-semibold py-3 rounded shadow hover:bg-indigo-700 transition duration-300"
          >
            Create Organisation
          </button>
        </form>

        <footer className="mt-6 text-center text-gray-500 text-sm">
          &copy; {new Date().getFullYear()} Tesseract. All rights reserved.
        </footer>
      </div>
    </div>
  );
};

export default CreateOrganisationPage;
